// MapIcons.js
import L from 'leaflet';

export const redIcon = new L.Icon({
  iconUrl: '/path/to/red-icon.png',
  iconSize: [25, 41],
  iconAnchor: [12, 41],
  popupAnchor: [1, -34],
});

export const defaultIcon = new L.Icon({
  iconUrl: '/path/to/default-icon.png',
  iconSize: [25, 41],
  iconAnchor: [12, 41],
  popupAnchor: [1, -34],
});
